    {id:2, name: 'Pizza Romana',  img: "/images/Romana.jpg",  ingredients:"Tomato sauce and mozzarella from Agerola",  price:"8.5",}
  ]

const members=  info.map(function(member){
  return <product
             img={member.img}
             name={member.name}
             ingredients={member.ingredients}
             price={member.price}
             />

})


return(
    <div className="row">
    {members}
      

    </div>
)
}
export default Products
